em residências artísticas (marque apenas 1 item)*?',NULL),(19,'13','2','Qual o apoio financeiro concedido (em reais) para que cada artista realize a ação (marque mais de 1 item em caso de diferentes valores concedidos em cada programa realizado)*?',NULL),(20,'14','2','O valor concedido já é deduzido do imposto de renda devido (marque apenas 1 item)*?',NULL),(21,'15','2','Em caso de não estarem incluídos no valor concedido, a instituição arcará com quais dos itens abaixo ( marque quantos itens julgar necessário)*',NULL),(22,'1','3','Quantos artistas foram apoiados em média ao ano?',NULL),(23,'2','3','O número de artistas apoiados foi o mesmo em todas os programas (marque apenas 1 item)?',NULL),(24,'3','3','Qual o período de duração da residência (marque apenas 1 item)* ?',NULL),(25,'4','3','Em relação à nacionalidade dos artistas contemplados(marque apenas 1 item)*?',NULL),(26,'5','3','Existe a possibilidade de intercâmbio entre artistas brasileiros e internacionais nos programas de residências artísticas(marque apenas 1 item)*?',NULL),(27,'6','3','Quanto à presença de artistas estrangeiros no Brasil e/ou artistas brasileiros no exterior que podem ser contemplados pelos programas(marque apenas 1 item)*',NULL),(28,'7','3','Os artistas podem ser provenientes de que países/continentes/ blocos internacionais? (marque quantos itens julgar necessário):',NULL),(29,'1','4','Quais as principais ações realizadas pelos artistas durante a residência (marque quantos itens julgar necessário)*?',NULL),(30,'2','4','Quais as linguagens envolvidas nas diferentes ações desenvolvidas em residências artísticas (marque quantos itens julgar necessário)*?',NULL),(31,'3','4','Qual o principal público a ser atingido pelas ações (marque no máximo os 3 itens mais importantes)*?',NULL),(32,'4','4','Onde as ações são realizadas (marque quantos itens julgar necessário)*?',NULL),(33,'5','4','Quais os produtos são resultados das ações realizadas (marque quantos itens julgar necessário)*?',NULL);
